$(function () {
	$("#slider-range").slider({
		range: true,
		min: 20,
		max: 700,
		values: [20, 700],
		slide: function (event, ui) {
			$("#amount").html("Price : $" + ui.values[0] + "  $" + ui.values[1]);
			$("#amount1").val(ui.values[0]);
			$("#amount2").val(ui.values[1]);
		}
	});
	$("#amount").html("Price : $" + $("#slider-range").slider("values", 0) +
		"  $" + $("#slider-range").slider("values", 1));

	$("#amount1").val($("#slider-range").slider("values", 0));
	$("#amount2").val($("#slider-range").slider("values", 1));
});


/*quantity input number custom pluggin*/
jQuery('<div class="quantity-nav"><div class="quantity-button quantity-up d-flex align-items-center justify-content-center"><i class="ei_arrow_carrot-up d-block"><span class="sr-only">icon</span></i></div><div class="quantity-button quantity-down d-flex align-items-center justify-content-center"><i class="ei_arrow_carrot-down d-block"><span class="sr-only">icon</span></i></div></div>').insertAfter('.quantity input');
jQuery('.quantity').each(function () {
	var spinner = jQuery(this),
		input = spinner.find('input[type="number"]'),
		btnUp = spinner.find('.quantity-up'),
		btnDown = spinner.find('.quantity-down'),
		min = input.attr('min'),
		max = input.attr('max');

	btnUp.click(function () {
		var oldValue = parseFloat(input.val());
		if (oldValue >= max) {
			var newVal = oldValue;
		} else {
			var newVal = oldValue + 1;
		}
		spinner.find("input").val(newVal);
		spinner.find("input").trigger("change");
	});

	btnDown.click(function () {
		var oldValue = parseFloat(input.val());
		if (oldValue <= min) {
			var newVal = oldValue;
		} else {
			var newVal = oldValue - 1;
		}
		spinner.find("input").val(newVal);
		spinner.find("input").trigger("change");
	});

});


